import "./App.css";
import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  useParams,
} from "react-router-dom";

// import "bootstrap/dist/css/bootstrap.min.css";
import "./assets/bootstrap/css/bootstrap.min.css";
import "./App.css";
import Home from "./pages/Home";
import List from "./pages/List";

import Covid19 from "./components/map";
import Navbar from "./components/navbar";
import TrendingTopics from "./components/trendingTopics";
import NameList from "./components/cardList";
import Footer from "./components/footer";
import Banner from "./components/banner";
// import GlobalHeatmap from "./components/globalHeatmap";

function Country() {
  const { country } = useParams();
  return <h3>Country: {country}</h3>;
}

export default function App() {
  return (
    <Router>
      <Navbar />
      <br />
      <Banner />
      <div className="container-fluid">
        <div className="row">
          <div className="col-4 col-lg-7 col-xl-8 offset-xl-0">
            <h3 className="text-muted m-3">Global Heatmap</h3>
            <div className="card shadow mb-4">
              <div className="card-body">
                <Covid19 />
              </div>
            </div>
            <h3 className="text-muted m-3">Trending Topics</h3>
            <div className="card shadow mb-4">
              <div className="card-body">
                <TrendingTopics />
              </div>
            </div>
          </div>
          <div className="col-lg-5 col-xl-4">
            <h3 className="text-muted m-3">Top Events</h3>
            <NameList />
          </div>
        </div>
      </div>
      <Route path="/events/mentions/:country" component={Country} />
      <Footer />
    </Router>
  );
}

